import React from 'react'

 class  MessageBox extends React.Component{
     constructor(props){
         super(props)
     }
     render(){
         console.log(this.props.messages)
         return(
             <div>{this.props.messages.map(e=>{
                 <h1></h1>
             })}</div>
         )
     }
 }

export default MessageBox;
